    value: The ASDC Dollars for Democrats is an ongoing joint fundraising program
      between the Association of State Democratic Chairs and the State Democratic
      Executive Committee of Alabama. Accordingly the ASDC provides memo schedules
      on a quarterly basis during a federal election year and not with each proceed
      transfer. Likewise the Democratic State Victory Fund is an ongoing direct mail
      joint fundraising program between the DNC and the State Democratic Executive
      Committee of Alabama. Accordingly the DNC provides memo schedules on a quarterly
      basis during a federal election year and not with each proceed transfer. The
      memo entries in this report reflect proceed transfers that are disclosed on
      other reports. The money used for the FEA activity was from permissible funds.
      The Levin account reported on Schedule L-A was opened September 2004. Levin
      receipts for the month of September are listed. Also reported are Levin receipts
      for a prior time period as permitted by the FEC.
